import React, { Component } from 'react'
import axios from 'axios'
import Item from './Article-Item'
import "./index.css"
export default class ArticleOnlineList extends Component {
  state = {
    essayList: [
      // { id: "1", title: "Title1", author: "新京报",date:"2021.1.1 12:31" },
      // { id: "2", title: "Title2", author: "新京报",date:"2021.1.1 12:31" },
      // { id: "3", title: "Title3", author: "新京报",date:"2021.1.1 12:31" },
    ],
  }
  componentDidMount(){
    console.log('componentDidMount');
    axios.get(`https://qcpi7s.fn.thelarkcloud.com/getArticleList`).then(
      response => {
        console.log(response.data.result[0].content);
        this.setState({essayList:response.data.result})
      },
      error => {
        console.log("失败了");
      }
    )
  }
  render() {
    const {essayList}= this.state
    return (
      <div className = "list">
        {
          essayList.map((essayObj)=>{
            return (<Item key={essayObj.articleID} {...essayObj}/>)
          })
        }
      </div>
    )
  }
}
